const htmlTemplate = `<div class="deposit-card"> <div class="deposit-card--container"> <div class="deposit-card--header"> <div class="deposit-card--header-group deposit-card--first-block"> <span class="deposit-card--header-title"> ${textTemplate.header} </span> <img src="${depositQuestionMark}" alt="Question" class="deposit-card--header-question"> </div><div class="deposit-card--header-group deposit-card--header-group-sponsors"> ${cards.map(function(el,i){return '<div class="deposit-card--header-sponsor"><img src="'+el+'" alt="Sponsor'+ i +'"></div>'}).join('')}</div></div><div class="deposit-card--body"> <div class="deposit-card--body-group-big"> <span class="deposit-card--body-title"> ${textTemplate.input.cardNumber.titleText}</span> <div class="deposit-card--body-input"> <span class="deposit-card--secret-text"> ${textTemplate.input.cardNumber.inputText} </span> </div></div><div class="deposit-card--body-group-small"> <div class="deposit-card--body-group deposit-card--body-group-1"> <span class="deposit-card--body-title"> ${textTemplate.input.expirationDate.titleText} </span> <div class="deposit-card--body-input"> <span class="deposit-card--secret-text"> ${textTemplate.input.expirationDate.inputText} </span> </div></div><div class="deposit-card--body-group deposit-card--body-group-2"> <span class="deposit-card--body-title"> ${textTemplate.input.cardSecurityCode.titleText} </span> <div class="deposit-card--body-input"> <span class="deposit-card--secret-text"> ${textTemplate.input.cardSecurityCode.inputText} </span> </div></div><img src="${depositCreditCard}" alt="Credit card" class="deposit-card--body-group-small-img-1"> <img src="${depositQuestionMark}" alt="Question mark" class="deposit-card--body-group-small-img-2"> </div></div><div class="deposit-card--footer"> <div class="deposit-card--footer-group deposit-card--footer-group-1"> <span class="deposit-card--footer-title"> ${textTemplate.input.amount.titleText} </span> <div class="deposit-card--footer-input"> <img src="${depositArrow}" alt="Arrow" class="deposit-arrow deposit-arrow-1"> <span class="deposit-card--secret-text"> ${textTemplate.input.amount.inputText[0]} </span> </div></div><div class="deposit-card--footer-group deposit-card--footer-group-2"> <div class="deposit-card--footer-input"> <img src="${depositArrow}" alt="Arrow" class="deposit-arrow deposit-arrow-2"> <span class="deposit-card--secret-text"> ${textTemplate.input.amount.inputText[1]} </span> </div></div></div><div class="deposit-card--footer-button"> ${textTemplate.button} <img src="${depositPasswordBtn}" alt="password"> <img src="${depositArrow}" alt="Arrow" class="deposit-arrow deposit-arrow-3"> </div></div></div>`;

const divElement = document.getElementById('deposit_screen');

divElement.insertAdjacentHTML('beforeEnd',htmlTemplate)  ; //append html
const depElement = document.querySelector('#deposit_screen .deposit-card');
/*Append css*/
const styleSheet = document.createElement("style");
styleSheet.type = "text/css";
styleSheet.innerText = cssTemplate;
document.head.appendChild(styleSheet);

let scale =2.4;
function scaleBlock() {
   if(window.innerWidth< 390){
    scale= 3
    }
    else{
        scale =2.4
    }

    let width  = (divElement.offsetWidth / depElement.offsetWidth ) /scale;
        
    depElement.style.transform ='scale('+(width)+') '; 
}
scaleBlock();

window.addEventListener('resize',function (e) {
    scaleBlock();
});